@variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"168864","type":"CustomJS"},{"attributes":{},"id":"168852","type":"AllLabels"},{"attributes":{"coordinates":null,"formatter":{"id":"168572"},"group":null,"major_label_policy":{"id":"168852"},"ticker":{"id":"168543"},"visible":false},"id":"168542","type":"LinearAxis"},{"attributes":{"coordinates":null,"group":null},"id":"168895","type":"Title"},{"attributes":{},"id":"168790","type":"UndoTool"},{"attributes":{"editor":{"id":"169060"},"field":"EntryBar","formatter":{"id":"169059"},"title":"EntryBar"},"id":"168942","type":"TableColumn"},{"attributes":{},"id":"168578","type":"LinearScale"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"168788","type":"WheelZoomTool"},{"attributes":{},"id":"168780","type":"BasicTicker"},{"attributes":{"editor":{"id":"169058"},"field":"Size","formatter":{"id":"169057"},"title":"Size"},"id":"168941","type":"TableColumn"},{"attributes":{},"id":"168791","type":"RedoTool"},{"attributes":{"dimensions":"width"},"id":"168787","type":"PanTool"},{"attributes":{},"id":"168853","type":"UnionRenderers"},{"attributes":{},"id":"168793","type":"SaveTool"},{"attributes":{},"id":"168726","type":"LinearScale"},{"attributes":{},"id":"168792","type":"ResetTool"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwP1bNXjuy1O8/BmbL0kPq7z+zKZ0o/uXv
